`,$N=()=>m.jsxs(ln,{title:"Reviews",description:"Reviews of artwork by Frances Kornbluth (1920 - 2014), an Abstract Expressionist painter who spent 57 summers painting on Monhegan Island off the coast of Maine.",children:[m.jsx(Nn,{children:"Reviews"}),m.jsx(zt,{className:"mt-5 mb-4",src:SI,title:"Path Clearing",medium:"Oil on canvas",dimensions:'24 x 24"'}),m.jsxs(Jl,{children:['"One of the best pieces in the show is ',m.jsx("em",{children:"Path Clearing"}),' by Frances Kornbluth, a small painting with dark colors and mysterious glowing light. Only through repeated viewing and careful examination does the spectator become aware of the very sensitive use of color in what initially seems to be only a dark mass. The separate trees may not be there but the forest certainly isbrooding and primeval. The work is delicately subtle, perhaps too subtle to attract the attention it deserves."']}),m.jsx(Zl,{children:"- Bernard Hanson (July 1980)"}),m.jsx(Be,{}),m.jsx(zt,{className:"mt-5 mb-4",src:xI,title:"Lobster Cove Suite #2",medium:"Acrylic on canvas",dimensions:'67 x 48.5"'}),m.jsxs(Jl,{children:['"In the 1980s, Kornbluth began experimenting with multiple canvases, several of which were triptychs. The most exciting of these is'," ",m.jsx("em",{children:"Lobster Cove Suite #2"}),'. This shows a marvelous range of her best colors: earthy greens and subtle blue-greys. The lower quarter of the painting is a larger piece of canvas with three equally spaced green squares, just the size of the sixteen mini-canvases above. Combined, they create a rocky terrain around an ocean inlet, with water cascading in and out around the viewer. The bold, emotional connection of the rocks and water and viewer is almost transcendental."']}),m.jsx(Zl,{children:"- Susan Wadsworth (August 1991)"}),m.jsx(Be,{}),m.jsxs(It,{className:"mt-5 mb-4",children:[m.jsx(Te,{lg:1}),m.jsx(Te,{lg:5,children:m.jsx(zt,{className:"mb-3 m-lg-0",src:db,title:"Winter Landscape",medium:"Collage on paper",dimensions:'22 x 30"'})}),m.jsx(Te,{lg:5,children:m.jsx(zt,{src:bI,title:"Germination",medium:"Acrylic on handmade paper",dimensions:'28 x 42"'})}),m.jsx(Te,{lg:1})]}),m.jsx(Jl,{children:'"One great pairing comprises Frances Kornbluths larger paintings. They are extremely similar in scale, size, shape and color, but they could hardly be more different, as one tilts towards landscape and the other insists on being abstract."'}),m.jsx(Zl,{children:"- Daniel Kany (January 2013)"}),m.jsx(Be,{}),m.jsx(zt,{className:"mt-5 mb-4",src:Nh,title:"Changing Light, Monhegan Ice Pond",medium:"Acrylic on linen",dimensions:'59 x 43"'}),m.jsxs(Jl,{children:['"Kornbluths ',m.jsx("em",{children:"Changing Light, Monhegan Ice Pond"}),' (1989) evokes a shimmering cascade of what might be moonlight on the water framed by colorful foliage."']}),m.jsx(Zl,{children:"- Carl Little (July 2024)"}),m.jsx(Be,{}),m.jsxs(Ie,{className:"mt-4 text-center",children:["See more artwork on the"," ",m.jsx(St,{to:_e.CollectionPage,children:"collection page"}),"."]})]}),Jl=ee(Ie).attrs({className:"pl-2"})``,Zl=ee(Ie).attrs({className:"pl-4 mb-4"})`
